import React from 'react';
import styled from 'styled-components';



const Nav = () => {
  return (
    <NavWrapper>
      <Logo onClick={() => (window.location.href = "/")}>
        <span>Ï£ºÎûë</span>
        <img alt="logo" src='/images/logo.svg' />
      </Logo>

      <SearchContainer>
        <SearchInput placeholder="Ï∞æÍ≥† Ïã∂ÏùÄ Î¨ºÌíàÏù¥ÎÇò ÎèôÎÑ§Î•º Í≤ÄÏÉâÌï¥Î≥¥ÏÑ∏Ïöî!" />
        <SearchIcon>üîç</SearchIcon>
      </SearchContainer>

      <NavItems>
        <NavItem>Ï§ëÍ≥†Î¨ºÌíà</NavItem>
        <NavItem>Í∏∞ÏóÖÏÜåÍ∞ú</NavItem>
        <NavItem>Ïù¥Î≤§Ìä∏</NavItem>
        <NavItem>Î≠êÌï¥ÏïºÎêòÏßÄ</NavItem>
      </NavItems>

      <UserActions>
        <UserAction>Î°úÍ∑∏Ïù∏</UserAction>
        <UserAction>ÌöåÏõêÍ∞ÄÏûÖ</UserAction>
        <UserAction>Í≥†Í∞ùÏÑºÌÑ∞</UserAction>
      </UserActions>

      <UserIcons>
        <UserIcon>üõí</UserIcon>
        <UserIcon>üí¨</UserIcon>
        <UserIcon>üë§</UserIcon>
      </UserIcons>


    </NavWrapper>


  );
}

export default Nav;

const NavWrapper = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  height: 20%;
  background-color: #ffffff;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0 36px;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  z-index: 3;
`;

const Logo = styled.div`
  display: flex;
  align-items: center;
  cursor: pointer;

  img {
    width: 40px;
    height: auto;
    margin-right: 10px;
  }

  span {
    font-size: 24px;
    color: #0080ff; /* Î°úÍ≥† ÏÉâÏÉÅ */
  }
`;

const SearchContainer = styled.div`

  flex: 1; /*ÎÇ®ÏùÄ Í≥µÍ∞ÑÏùÑ Î™®Îëê Ï∞®ÏßÄ ÌïòÎèÑÎ°ù ÏÑ§Ï†ï*/
  margin: 0 20px;
`;

const SearchInput = styled.input`

  width: 30%;
  position: relative;
  transform: translateX(-80%); 
  padding: 10px 40px; /* ÏïÑÏù¥ÏΩòÏùÑ ÏúÑÌïú Ïó¨Î∞± */
  border: 2px solid #0080ff;
  border-radius: 20px;
  outline: none;
  font-size: 16px;
  cursor: pointer;

  &::placeholder {   /*& -> ÌòÑÏû¨ Ï†ÅÏö©ÎêòÎäî Î∂ÄÎ∂Ñ Ïñ∏Í∏â */
    color: #aaa;

  }
`;

const SearchIcon = styled.span`
  position: absolute;
  left:40%; /* Ïò§Î•∏Ï™Ω ÎÅùÏóêÏÑú 10% ÏúÑÏπò */
  top: 50%; /* ÏöîÏÜåÏùò ÏÉÅÎã®ÏùÑ Î∂ÄÎ™® ÏöîÏÜåÏùò ÎÜíÏù¥Ïùò 50% ÏúÑÏπòÏóê Î∞∞Ïπò */ 
  transform: translateY(-50%);  /* ÏûêÏã†Ïùò ÎÜíÏù¥Ïùò 50%ÎßåÌÅº ÏúÑÎ°ú Ïù¥Îèô */
  font-size: 20px; /* ÏïÑÏù¥ÏΩò ÌÅ¨Í∏∞ Ï°∞Ï†ï */
  pointer-events: none; /* ÏïÑÏù¥ÏΩò ÌÅ¥Î¶≠ Î∞©ÏßÄ */
`;



const NavItems = styled.div`
  display: flex;
  align-items: center;
  position: absolute;
  top: 80%;
  left:5%;
`;


const NavItem = styled.div`
  margin: 0 100px;
  font-size: 16px;
  color: #333;
  cursor: pointer;

  &:hover {
    color: #0080ff;
  }
`;

const UserActions = styled.div`
  position: absolute;
  top: 20%;
  right: 5%;
  display: flex; /*flex conatainerÍ∞Ä Îê®, Í∏∞Î≥∏Ïù¥ row */
  align-items: center;
`;

const UserAction = styled.div`
  margin: 0 10px;
  font-size: 16px;
  color: #aaa;
  cursor: pointer;

  &:hover {
    color: #0080ff;
  }
`;


const UserIcons = styled.div`
  position: absolute;
  top: 50%;
  right:7%;
  display: flex; /*flex conatainerÍ∞Ä Îê®, Í∏∞Î≥∏Ïù¥ row */
  align-items: center;




`
;

const UserIcon = styled.div`
  margin: 0 17px;
  font-size: 25px;
  cursor: pointer;
`;
